import { Card, Typography } from '@mui/material'
import React from 'react'

export default function RestaurantOrder() {
  return (
    <div>
      <Card>
        <Typography sx={{
          paddingBottom: "1rem"
        }}
        variant='h5'
        >
          Order Status
        </Typography>
      </Card>
    </div>
  )
}
